/*Table structure for table `sys_menu` */

DROP TABLE IF EXISTS `sys_menu`;

CREATE TABLE `sys_menu` (
  `id_` varchar(32) NOT NULL COMMENT '菜单编号',
  `name_` varchar(255) default NULL COMMENT '菜单名称',
  `page_url` varchar(255) default NULL COMMENT '页面地址',
  `display_type` varchar(50) default NULL COMMENT '显示方式(左侧菜单menu;按钮button)',
  `parent_id` varchar(32) default NULL COMMENT '上级菜单',
  `sort_no` int(11) default NULL COMMENT '排序号',
  `code_` varchar(50) default NULL COMMENT '菜单编码',
  `target_` varchar(32) default NULL COMMENT '目标',
  `icon_url` varchar(255) default NULL,
  PRIMARY KEY  (`id_`),
  UNIQUE KEY `unique_sys_menu_code` USING BTREE (`code_`),
  KEY `FK_9ogfu2m8yudrxxnkpt17icdiv` USING BTREE (`parent_id`),
  CONSTRAINT `sys_menu_ibfk_1` FOREIGN KEY (`parent_id`) REFERENCES `sys_menu` (`id_`)
